import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { IUser } from 'src/app/interface/user.interface';
import { User } from '../../../model/user';
import { UserService } from '../../../service/user.service';

@Component({
  selector: 'app-user-list',
  templateUrl: './user-list.component.html',
  styleUrls: ['./user-list.component.css']
})
export class UserListComponent implements OnInit {

  users: User[];



  constructor(private userService: UserService, private router: Router) { }

  ngOnInit(): void {

    this.checkLogin();

    this.getUsers();
  }

  private getUsers(){
    // debugger
    this.userService.getUserList().subscribe(data => {
      this.users = data;

      for(let i=0; i<this.users.length; i++){
        this.users[i]['type']="password";
        this.users[i]['bname']="Show";
      }

    });
  }
  updateUser(id: number){
    console.log(id);
    this.router.navigate(['/landing-page/update-user', id]);
  }

  deleteUser(id: number){
    // console.log(id);
    // this.router.navigate(['/landing-page/delete-user', id]);
    this.userService.deleteUser(id).subscribe(
      data => {
        console.log(data);
        this.getUsers();
      }, error => {
        console.log("Not Delete")
      }
    )
  }

  checkLogin(){

  //Local storage Start
   const userid =  localStorage.getItem('userid');
   const username =  localStorage.getItem('username');
   const password =  localStorage.getItem('password');
   const role =  localStorage.getItem('role');
   console.log(username);


   let user = new User();
    user.userId=Number(userid);
    user.userName=String(username);
    user.password=String(password);
    user.role=String(role);
    this.userService.loginUserFromRemote(user).subscribe(
      (data: IUser) => {
        return true;
      },

        error => {
          this.router.navigate(['/login']);

      }
    );
}


showpassword(type:any,index:any){
  // this.admins[index].type='text'

  if(type=='text'){
    this.users[index].type='password'
    this.users[index].bname='Show'
  } else{
    this.users[index].type='text'
    this.users[index].bname='Hide'
  }

}

}
<div class="container">

    <div class="row justify-content-center mt-5">
      <h1> <u>User List</u> </h1>
    </div>
    <button routerLink="/landing-page/create-user" class="btn btn-primary ml-auto ml-5 mb-3">
      Add User
    </button>
  <table class="table table-striped " style="margin-bottom: 100px;">
    <thead>
      <tr>
        <th>User Id</th>
        <th>User Name</th>
        <th>Password</th>
        <th>Role</th>
        <th>Actions</th>
      </tr>
    </thead>
    <tbody>
      <tr *ngFor="let user of users; let i=index">
        <td>{{user.userId}}</td>
        <td>{{user.userName}}</td>
        <td><input name="{{i}}" readonly type="{{user.type}}" [ngStyle]="{backgroundColor: i%2==0  ? '#f2f2f2' : 'white'}" [(ngModel)]="user.password"  style="outline: none;border: none; " />
        <button (click)="showpassword(user.type,i)">{{user.bname}}</button>
        <td>{{user.role}}</td>
        <td>
          <button button (click) = "updateUser(user.userId)" class="btn btn-info" >Update</button>
          <button button (click) = "deleteUser(user.userId)" class="btn btn-danger" style="margin-left: 10px;" >Delete</button>
        </td>
      </tr>
    </tbody>
  </table>

</div>
